// export default Hero;
import React, { useState } from 'react';
import { Menu, X, Facebook, Twitter, Instagram, Youtube, Send } from 'lucide-react';

// Import your actual components when integrating:
// import MainCard from '../ItemCard/ItemCard';
// import Footer from '../Footer/Footer';
import haaderImg from '../../Assets/header.png';
function Hero() {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <>
      {/* Navbar */}
      <nav style={styles.navbar}>
        {/* Logo */}
        <div style={styles.logoContainer}>
          <div style={styles.logoIcon}>SE</div>
          <span style={styles.logoText}>SHAZII ENTERPRISES</span>
        </div>

        {/* Desktop Navigation Links */}
        <ul style={styles.navLinks} className="nav-links-desktop">
          <li style={styles.navItem}><a href="/" style={styles.navLink}>Home</a></li>
          <li style={styles.navItem}><a href="/services" style={styles.navLink}>Services</a></li>
          <li style={styles.navItem}><a href="/showroom" style={styles.navLink}>Showroom</a></li>
          <li style={styles.navItem}><a href="/about" style={styles.navLink}>About Us</a></li>
          <li style={styles.navItem}><a href="/contact" style={styles.navLink}>Contact US</a></li>
        </ul>

        {/* Hamburger Menu Icon */}
        <button 
          onClick={toggleMenu}
          style={styles.hamburgerButton}
          className="hamburger-button"
          aria-label="Toggle menu"
        >
          {isOpen ? <X size={28} color="#333" /> : <Menu size={28} color="#333" />}
        </button>
      </nav>

      {/* Mobile Menu Overlay */}
      {isOpen && (
        <div style={styles.mobileMenu}>
          <a href="/" onClick={toggleMenu} style={styles.mobileLink}>Home</a>
          <a href="/services" onClick={toggleMenu} style={styles.mobileLink}>Services</a>
          <a href="/showroom" onClick={toggleMenu} style={styles.mobileLink}>Showroom</a>
          <a href="/about" onClick={toggleMenu} style={styles.mobileLink}>About Us</a>
          <a href="/contact" onClick={toggleMenu} style={styles.mobileLink}>Contact US</a>
        </div>
      )}

      {/* Hero Section */}
      <div style={styles.heroSection}>
        {/* Background overlay */}
        <div style={styles.heroOverlay}></div>

        {/* Hero Content */}
        <div style={styles.heroContent}>
          <div style={styles.heroTextContainer}>
            <h1 style={styles.heroTitle}>SHAZII ENTERPRISES</h1>
            <p style={styles.heroSubtitle}>Our Business is to bring smile on your face</p>

            {/* Social Media Icons */}
            <div style={styles.socialContainer}>
              <a href="#facebook" style={styles.socialIcon} aria-label="Facebook">
                <Facebook size={20} />
              </a>
              <a href="#twitter" style={styles.socialIcon} aria-label="Twitter">
                <Twitter size={20} />
              </a>
              <a href="#instagram" style={styles.socialIcon} aria-label="Instagram">
                <Instagram size={20} />
              </a>
              <a href="#youtube" style={styles.socialIcon} aria-label="YouTube">
                <Youtube size={20} />
              </a>
              <a href="#telegram" style={styles.socialIcon} aria-label="Telegram">
                <Send size={20} />
              </a>
            </div>
          </div>

          {/* Business Meeting Illustration Placeholder */}
          <div style={styles.heroImageContainer}>
       
            <img src={haaderImg} alt="Shazii Enterprises Team" style={styles.heroImage} />
            <div style={styles.imagePlaceholder}>
              <p style={styles.placeholderText}>Place your header image here</p>
            </div>
          </div>
        </div>
      </div>

      {/* Below Hero Sections */}
      <div style={styles.contentSection}>
        {/* Uncomment these when integrating with your actual components */}
        {/* <div className="Card_container">
          <MainCard />
        </div>
        <div>
          <Footer />
        </div> */}
        <div style={styles.placeholder}>
          <p>MainCard Component Section</p>
        </div>
        <div style={styles.placeholder}>
          <p>Footer Component Section</p>
        </div>
      </div>

      {/* Responsive Styles */}
      <style>{`
        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }

        .nav-links-desktop {
          display: flex;
        }

        .hamburger-button {
          display: none;
        }

        @media (max-width: 968px) {
          .nav-links-desktop {
            display: none !important;
          }
          
          .hamburger-button {
            display: block !important;
          }
        }

        @media (max-width: 768px) {
          h1 {
            font-size: 2rem !important;
          }
          
          p {
            font-size: 1rem !important;
          }
        }

        a:hover {
          color: #ff6b9d;
        }
      `}</style>
    </>
  );
}

const styles = {
  // Navbar Styles
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '1rem 3rem',
    backgroundColor: '#fff',
    boxShadow: '0 2px 8px rgba(0,0,0,0.08)',
    position: 'sticky',
    top: 0,
    zIndex: 1000
  },
  logoContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '0.75rem'
  },
  logoIcon: {
    width: '45px',
    height: '45px',
    background: 'linear-gradient(135deg, #ff6b9d 0%, #c94b7f 100%)',
    borderRadius: '10px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    color: 'white',
    fontSize: '20px',
    fontWeight: 'bold',
    boxShadow: '0 4px 12px rgba(255,107,157,0.3)'
  },
  logoText: {
    fontSize: '13px',
    fontWeight: '700',
    color: '#333',
    letterSpacing: '1px'
  },
  navLinks: {
    display: 'flex',
    listStyle: 'none',
    gap: '2.5rem',
    margin: 0,
    padding: 0,
    alignItems: 'center'
  },
  navItem: {
    listStyle: 'none'
  },
  navLink: {
    textDecoration: 'none',
    color: '#333',
    fontSize: '15px',
    fontWeight: '500',
    transition: 'color 0.3s ease',
    cursor: 'pointer'
  },
  hamburgerButton: {
    background: 'none',
    border: 'none',
    cursor: 'pointer',
    padding: '8px',
    display: 'none'
  },
  
  // Mobile Menu Styles
  mobileMenu: {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100%',
    height: '100vh',
    backgroundColor: 'white',
    zIndex: 999,
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    gap: '2.5rem',
    animation: 'fadeIn 0.3s ease'
  },
  mobileLink: {
    textDecoration: 'none',
    color: '#333',
    fontSize: '24px',
    fontWeight: '600',
    transition: 'color 0.3s ease'
  },

  // Hero Section Styles
  heroSection: {
    position: 'relative',
    width: '100%',
    minHeight: '550px',
    background: 'linear-gradient(135deg, #ffffff 0%, #f8f9fa 100%)',
    overflow: 'hidden'
  },
  heroOverlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '100%',
    height: '100%',
    background: 'radial-gradient(circle at 80% 20%, rgba(255,107,157,0.08) 0%, transparent 50%)',
    pointerEvents: 'none'
  },
  heroContent: {
    position: 'relative',
    zIndex: 1,
    maxWidth: '1400px',
    margin: '0 auto',
    padding: '4rem 3rem',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    minHeight: '550px',
    gap: '3rem'
  },
  heroTextContainer: {
    flex: '1',
    maxWidth: '600px'
  },
  heroTitle: {
    fontSize: '3.5rem',
    fontWeight: '900',
    color: '#1a1a1a',
    marginBottom: '1rem',
    letterSpacing: '-1.5px',
    lineHeight: '1.1'
  },
  heroSubtitle: {
    fontSize: '1.4rem',
    color: '#555',
    fontWeight: '300',
    marginBottom: '2.5rem',
    lineHeight: '1.6'
  },
  socialContainer: {
    display: 'flex',
    gap: '1rem',
    marginTop: '2rem'
  },
  socialIcon: {
    width: '45px',
    height: '45px',
    borderRadius: '50%',
    backgroundColor: 'white',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    color: '#333',
    textDecoration: 'none',
    boxShadow: '0 4px 12px rgba(0,0,0,0.08)',
    transition: 'all 0.3s ease',
    cursor: 'pointer'
  },
  heroImageContainer: {
    flex: '1',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    minHeight: '400px'
  },
  heroImage: {
    maxWidth: '100%',
    height: 'auto',
    objectFit: 'contain'
  },
  imagePlaceholder: {
    width: '100%',
    height: '400px',
    background: 'linear-gradient(135deg, #f0f0f5 0%, #e8e8ed 100%)',
    borderRadius: '15px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    border: '2px dashed #ccc'
  },
  placeholderText: {
    color: '#999',
    fontSize: '18px',
    fontWeight: '500'
  },

  // Content Section Styles
  contentSection: {
    width: '100%',
    backgroundColor: '#fff'
  },
  placeholder: {
    padding: '3rem',
    textAlign: 'center',
    color: '#999',
    borderTop: '1px solid #eee'
  }
};

export default Hero;
